import "./Supermarket.css";
import coopImg from "./img/mapToCOOP.png"
import euroImg from "./img/mapToEURO.png"
import pennyImg from "./img/mapToPENNY.png"

const Supermarket = () => {
  return (
    <div className="backgroundSuper">
      <div className="bannerSuper" id="landing">
        Supermarket
      </div>
      <div className="mapsContainer">
        <div className="mapCoopImage">
          <a href="http://maps.apple.com/?q=37.08825761369096,15.159846916778568" rel="noreferrer" target="_blank"><img src={coopImg} alt="coop" /> </a>
        </div>
        <div className="mapEuroImage">
          <a href="http://maps.apple.com/?q=37.08825761369096,15.159846916778568" rel="noreferrer" target="_blank"><img src={coopImg} alt="coop" /> </a>
        </div>
        <div className="mapPennyImage">
          <a href="http://maps.apple.com/?q=37.08825761369096,15.159846916778568" rel="noreferrer" target="_blank"><img src={coopImg} alt="coop" /> </a>
        </div>
      </div>
    </div>
  );
};

export default Supermarket;
